import { Button, TableCell, TableRow } from "@mui/material";
import { Edit, Delete } from "@mui/icons-material";

export default function TablesClientRow(props) {

    const consultClick = {
        onClick: () => props.handleClickRow(props.idPersona)
    }


    return (
        <TableRow hover
            tabIndex={-1}
            // onClick={() => props.handleClickRow(props.idPersona)}
            sx={{ cursor: 'pointer' }}
        >
            <TableCell align='left' key={"idPersona"}  {...consultClick}> {props.idPersona}</TableCell>
            <TableCell align='left' key={"nombre"} {...consultClick}> {props.nombre}</TableCell>
            <TableCell align='left' key={"apellido"}> {props.apellido}</TableCell>
            <TableCell align='left' key={"numdoc"}> {props.numeroDocumento}</TableCell>
            <TableCell align='left' key={"tipoDoc"}> {props.tipoDoc}</TableCell>
            <TableCell align='left' key={"fechaNac"}> {props.fechaNac}</TableCell>
            <TableCell align='left' key={"editButton"}> <Button variant='contained' onClick={props.handleEditClick} sx={{zIndex:0}}><Edit/></Button></TableCell>
            <TableCell align='left' key={"deleteButton"}> <Button variant='contained' onClick={props.handleDeleteClick} color='error'><Delete/></Button></TableCell>

        </TableRow>
    )
}
